import Link from 'next/link';

import headerStyles from './header.module.scss';

export default function Header() {
  return (
    <header className={headerStyles.headerContainer}>
      <h1>Next.js Weather</h1>
      <nav>
        <ul>
          <li><Link href="/"><a>Home</a></Link></li>
        </ul>
      </nav>
    </header>
  )
}
